import headerstyle from '../styles/footer.module.css'
import utilStyles from '../styles/utils.module.css'

export default function Header() {
  return (
      <header className={headerstyle.header}>
        <h1 className={utilStyles.heading2Xl}></h1>
      </header>
  );
}
